import logo from '../resources/apex_logo.svg';
import '../App.css';

function Header() {
  return (
    <header className="App-header">
        <img src={logo} className="App-logo" alt="logo"/>
        <p>
            ApexBots
        </p>
        <br/>
        <p>
            ApexDivination
        </p>
    </header>
  );
}

export default Header;
